css:
.top-bar {
    font-size: 95%;
    background-color: #d690a9; 
}

.banner-slider {
    width: 100%;
    max-width: 120rem;
    height: auto;
    height: calc(100vw*var(--banner-aspect-ratio) - 5px);
    max-height: calc(120rem*var(--banner-aspect-ratio));
    margin: 0 auto;
}

.info-bar 
{
    width: 100%;
    max-width: 100%;
    margin-left: auto;
    margin-right: auto;
    background: #d690a9;
    color: #fff;
}
